					Count = Count - 1
				elseif (RandomNumber >= 200 and RandomNumber < 300) then
					if (wyrmsun.tileset ~= "dungeon" and wyrmsun.tileset ~= "cave") then
						unit = CreateUnit("unit-flowers", 15, {RandomX, RandomY})
						Count = Count - 1
					end
				elseif (RandomNumber >= 300 and RandomNumber < 400) then
					if (wyrmsun.tileset ~= "dungeon" and wyrmsun.tileset ~= "cave") then
						unit = CreateUnit("unit-large-flower", 15, {RandomX, RandomY})
						Count = Count - 1
					end
				elseif (RandomNumber >= 400 and RandomNumber < 600) then
					if (wyrmsun.tileset == "cave" and SyncRand(2) == 0) then
						unit = CreateUnit("unit-stalagmites", 15, {RandomX, RandomY})
						Count = Count - 1
					else
						unit = CreateUnit("unit-small-rocks", 15, {RandomX, RandomY})
						Count = Count - 1
					end
				elseif (RandomNumber >= 600 and RandomNumber < 800) then
					if (wyrmsun.tileset ~= "dungeon" and wyrmsun.tileset ~= "cave") then
						unit = CreateUnit("unit-twigs", 15, {RandomX, RandomY})
						Count = Count - 1
					elseif (wyrmsun.tileset == "dungeon" and GetTileTerrainName(RandomX, RandomY) == "floor") then
						unit = CreateUnit("unit-floor-decoration", 15, {RandomX, RandomY})
						Count = Count - 1
					end
				elseif (RandomNumber >= 800 and RandomNumber < 875) then
					if (wyrmsun.tileset ~= "dungeon" and wyrmsun.tileset ~= "cave") then
						unit = CreateUnit("unit-fern", 15, {RandomX, RandomY})
						Count = Count - 1
					end
				elseif (RandomNumber >= 875 and RandomNumber < 900) then
					if (wyrmsun.tileset ~= "dungeon" and wyrmsun.tileset ~= "cave") then
						unit = CreateUnit("unit-log", 15, {RandomX, RandomY})
						Count = Count - 1
					end
				elseif (RandomNumber >= 900 and RandomNumber < 999) then
					unit = CreateUnit("unit-bones", 15, {RandomX, RandomY})
					Count = Count - 1
				elseif (RandomNumber >= 999) then
					if (wyrmsun.tileset == "swamp") then
						unit = CreateUnit("unit-wyrm-skeleton", 15, {RandomX, RandomY})
						Count = Count - 1
					else
						unit = CreateUnit("unit-bones", 15, {RandomX, RandomY})
						Count = Count - 1
					end
				end
			elseif (GetTileTerrainName(RandomX, RandomY) == "dwarf-closed-wall" and GetNumUnitsAt(15, "any", {RandomX, RandomY}, {RandomX, RandomY}) < 1) then
				unit = CreateUnit("unit-outer-wall-decoration", 15, {RandomX, RandomY})
				Count = Count - 1
			elseif (GetTileTerrainName(RandomX, RandomY) == "dwarf-open-wall" and GetNumUnitsAt(15, "any", {RandomX, RandomY}, {RandomX, RandomY}) < 1) then
				unit = CreateUnit("unit-inner-wall-decoration", 15, {RandomX, RandomY})
				Count = Count - 1
			end
		end
	end
end

function CreatePlayers(min_x, max_x, min_y, max_y)
	-- create player units
	for i=0,14 do
		if (Map.Info.PlayerType[i] == PlayerPerson or Map.Info.PlayerType[i] == PlayerComputer) then
			local possible_civilizations = {}
			if ((wyrmsun.tileset == "cave" or wyrmsun.tileset == "swamp") and table.getn(GetCivilizationAvailableFactions("dwarf")) > 0) then
				table.insert(possible_civilizations, "dwarf")
			end
			if ((wyrmsun.tileset == "forest" or wyrmsun.tileset == "fairlimbed_forest") and table.getn(GetCivilizationAvailableFactions("germanic")) > 0) then -- allow germanic humans in elven forests since there is no elven civilization yet
				table.insert(possible_civilizations, "germanic")
			end
			if (GetPlayerData(i, "AiEnabled") and (wyrmsun.tileset == "cave" or wyrmsun.tileset == "swamp" or wyrmsun.tileset == "fairlimbed_forest") and table.getn(GetCivilizationAvailableFactions("gnome")) > 0) then -- allow gnomes in elven forests since there is no elven civilization yet
				table.insert(possible_civilizations, "gnome")
			end
			if (GetPlayerData(i, "AiEnabled") and (wyrmsun.tileset == "cave" or wyrmsun.tileset == "swamp") and table.getn(GetCivilizationAvailableFactions("goblin")) > 0) then
				table.insert(possible_civilizations, "goblin")
			end
			if (table.getn(possible_civilizations) < 1) then
				Map.Info.PlayerType[i] = PlayerNobody
			else
				SetPlayerData(i, "RaceName", possible_civilizations[SyncRand(table.getn(possible_civilizations)) + 1])

				local player_spawn_point
				local starting_point_found = false
				while (starting_point_found == false) do
					player_spawn_point = {SyncRand(max_x - min_x) + min_x, SyncRand(max_y - min_y) + min_y}
					starting_point_found = true
					if ((player_spawn_point[1] + 4) > Map.Info.MapWidth or (player_spawn_point[2] + 4) > Map.Info.MapHeight or (player_spawn_point[1] - 1) < 0 or (player_spawn_point[2] - 1) < 0) then
						starting_point_found = false
					end
					for j=0,14 do
						if (j < i and (Map.Info.PlayerType[j] == PlayerPerson or Map.Info.PlayerType[j] == PlayerComputer)) then
							if (math.abs(player_spawn_point[1] - Players[j].StartPos.x) < 32 and math.abs(player_spawn_point[2] - Players[j].StartPos.y) < 32) then
								starting_point_found = false
							end
						end
					end
				end
				
				SetStartView(i, player_spawn_point[1], player_spawn_point[2])
				for sub_x=-1,4 do
					for sub_y=-1,4 do
						SetRawTile(player_spawn_point[1] + sub_x, player_spawn_point[2] + sub_y, "Road")
					end
				end
				for sub_x=0,3 do
					for sub_y=0,3 do
						SetRawTile(player_spawn_point[1] + sub_x, player_spawn_point[2] + sub_y, "Town Hall " .. i)
					end
				end
				CreateStartingGoldMine(i) -- create the player's gold mine

				SetPlayerData(i, "Resources", "gold", 10000)
				SetPlayerData(i, "Resources", "lumber", 3000)
				SetPlayerData(i, "Resources", "oil", 1000)
				SetAiType(i, "land-attack")
			end
		end
	end

	SetPlayerData(15, "RaceName", "neutral")
end

function SetMapBorders(tile_type, replace_tile)

	for x=0,(Map.Info.MapWidth - 1) do
		if (RawTile(x, 0) == "" or replace_tile == true) then
			SetRawTile(x, 0, tile_type)
		end
		if (RawTile(x, 1) == "" or replace_tile == true) then
			SetRawTile(x, 1, tile_type)
		end

		if (RawTile(x, Map.Info.MapHeight - 2) == "" or replace_tile == true) then
			SetRawTile(x, Map.Info.MapHeight - 2, tile_type)
		end
		if (RawTile(x, Map.Info.MapHeight - 1) == "" or replace_tile == true) then
			SetRawTile(x, Map.Info.MapHeight - 1, tile_type)
		end
	end
	for y=0,(Map.Info.MapHeight - 1) do
		if (RawTile(0, y) == "" or replace_tile == true) then
			SetRawTile(0, y, tile_type)
		end
		if (RawTile(1, y) == "" or replace_tile == true) then
			SetRawTile(1, y, tile_type)
		end

		if (RawTile(Map.Info.MapWidth - 2, y) == "" or replace_tile == true) then
			SetRawTile(Map.Info.MapWidth - 2, y, tile_type)
		end
		if (RawTile(Map.Info.MapWidth - 1, y) == "" or replace_tile == true) then
			SetRawTile(Map.Info.MapWidth - 1, y, tile_type)
		end
	end
end

