function SetRawTile(x, y, tile_type)
	if (x >= 0 and x < Map.Info.MapWidth and y >= 0 and y < Map.Info.MapHeight) then
		RawTiles[y+1][x+1] = tile_type
	end
end

function RawTile(x, y)
	if (x >= 0 and x < Map.Info.MapWidth and y >= 0 and y < Map.Info.MapHeight) then
		return RawTiles[y+1][x+1]
	elseif (x < 0 and y >= 0 and y < Map.Info.MapHeight and RawTiles[y+1][0+1] ~= "Wall") then
		return RawTiles[y+1][0+1]
	elseif (x >= Map.Info.MapWidth and y >= 0 and y < Map.Info.MapHeight and RawTiles[y+1][Map.Info.MapWidth] ~= "Wall") then
		return RawTiles[y+1][Map.Info.MapWidth]
	elseif (x >= 0 and x < Map.Info.MapWidth and y < 0 and RawTiles[0+1][x+1] ~= "Wall") then
		return RawTiles[0+1][x+1]
	elseif (x >= 0 and x < Map.Info.MapWidth and y >= Map.Info.MapHeight and RawTiles[Map.Info.MapHeight][x+1] ~= "Wall") then
		return RawTiles[Map.Info.MapHeight][x+1]
	elseif (x < 0 and y < 0 and RawTiles[0+1][0+1] ~= "Wall") then
		return RawTiles[0+1][0+1]
	elseif (x >= Map.Info.MapWidth and y < 0 and RawTiles[0+1][Map.Info.MapWidth] ~= "Wall") then
		return RawTiles[0+1][Map.Info.MapWidth]
	elseif (x < 0 and y >= Map.Info.MapHeight and RawTiles[Map.Info.MapHeight][0+1] ~= "Wall") then
		return RawTiles[Map.Info.MapHeight][0+1]
	elseif (x >= Map.Info.MapWidth and y >= Map.Info.MapHeight and RawTiles[Map.Info.MapHeight][Map.Info.MapWidth] ~= "Wall") then
		return RawTiles[Map.Info.MapHeight][Map.Info.MapWidth]
	else
		return ""
	end
end

function ApplyRawTiles()
	if (Editor.Running == EditorNotRunning) then
		-- destroy mushrooms that ended up in inappropriate locations
		local uncount = 0
		uncount = GetUnits(15)
		for unit1 = 1,table.getn(uncount) do 
			if (GetUnitVariable(uncount[unit1], "Ident") == "unit-mushroom-patch") then
				if (RawTile(GetUnitVariable(uncount[unit1],"PosX"), GetUnitVariable(uncount[unit1],"PosY")) == "Water" or RawTile(GetUnitVariable(uncount[unit1],"PosX"), GetUnitVariable(uncount[unit1],"PosY")) == "Rock" or RawTile(GetUnitVariable(uncount[unit1],"PosX"), GetUnitVariable(uncount[unit1],"PosY")) == "Tree") then
					KillUnitAt("unit-mushroom-patch", 15, 1, {GetUnitVariable(uncount[unit1],"PosX"), GetUnitVariable(uncount[unit1],"PosY")}, {GetUnitVariable(uncount[unit1],"PosX"), GetUnitVariable(uncount[unit1],"PosY")})
				end
			end
		end
	end

	for x=0,(Map.Info.MapWidth - 1) do
		for y=0,(Map.Info.MapHeight - 1) do
			if (RawTile(x, y) == "Mush") then
				SetRawTile(x, y, "Land")
				if (SyncRand(4) <= 2) then
					unit = CreateUnit("unit-mushroom-patch", 15, {x, y})
				end
			elseif (RawTile(x, y) == "Tree" and (wyrmsun.tileset == "cave" or wyrmsun.tileset == "dungeon")) then -- if the cave or dungeon tileset is being used, then the trees are wood pile objects instead, and the tile is set to buildable land
				SetRawTile(x, y, "Land")
				unit = CreateUnit("unit-wood-pile", 15, {x, y})
				SetResourcesHeld(unit, 100)
			elseif (RawTile(x, y) == "DpWtr") then -- no tilesets have Deep Water yet, so it should be treated as normal water for now
				SetRawTile(x, y, "Water")
			elseif (RawTile(x, y) == "Road") then
				SetRawTile(x, y, "Land")
			elseif (RawTile(x, y) == "Gold Mine") then
				unit = CreateUnit("unit-gold-mine", 15, {x, y})
				SetResourcesHeld(unit, 50000)
				for sub_x=0,2 do
					for sub_y=0,2 do
						SetRawTile(x + sub_x, y + sub_y, "Land")
					end
				end
			elseif (string.sub(RawTile(x, y), 0, 9) == "Town Hall") then
				unit = CreateUnit("unit-germanic-town-hall", tonumber(string.sub(RawTile(x, y), 10)), {x, y})
				for sub_x=0,3 do
					for sub_y=0,3 do
						SetRawTile(x + sub_x, y + sub_y, "Land")
					end
				end
			elseif (string.sub(RawTile(x, y), 0, 4) == "Farm") then
				unit = CreateUnit("unit-germanic-farm", tonumber(string.sub(RawTile(x, y), 5)), {x, y})
				for sub_x=0,1 do
					for sub_y=0,1 do
						SetRawTile(x + sub_x, y + sub_y, "Land")
					end
				end
			elseif (string.sub(RawTile(x, y), 0, 11) == "Lumber Mill") then
				unit = CreateUnit("unit-germanic-carpenters-shop", tonumber(string.sub(RawTile(x, y), 12)), {x, y})
				for sub_x=0,2 do
					for sub_y=0,2 do
						SetRawTile(x + sub_x, y + sub_y, "Land")
					end
				end
			elseif (string.sub(RawTile(x, y), 0, 5) == "Smith") then
				unit = CreateUnit("unit-dwarven-smith", tonumber(string.sub(RawTile(x, y), 6)), {x, y})
				for sub_x=0,2 do
					for sub_y=0,2 do
						SetRawTile(x + sub_x, y + sub_y, "Land")
					end
				end
			end
		end
	end

	local RandomNumber = 0

	for x=0,(Map.Info.MapWidth - 1) do
		for y=0,(Map.Info.MapHeight - 1) do
			local solid_slot = 0
			local mixed_slot = 0
			if (RawTile(x, y) == "Water") then
				solid_slot = 1
				mixed_slot = 2
			elseif (RawTile(x, y) == "Rough") then
				solid_slot = 3
				mixed_slot = 5
			elseif (RawTile(x, y) == "Dark-Rough") then
				solid_slot = 4
				mixed_slot = 3
			elseif (RawTile(x, y) == "Land") then
				solid_slot = 5
			elseif (RawTile(x, y) == "Dark-Land") then
				solid_slot = 6
				mixed_slot = 6
			elseif (RawTile(x, y) == "Tree") then
				solid_slot = 7
				mixed_slot = 7
			elseif (RawTile(x, y) == "Rock") then
				solid_slot = 8
				mixed_slot = 4
			end
			if (RawTile(x, y) == "Water" or RawTile(x, y) == "Dark-Rough" or RawTile(x, y) == "Land" or RawTile(x, y) == "Dark-Land" or RawTile(x, y) == "Tree" or RawTile(x, y) == "Rock") then
				if (mixed_slot ~= 0 and RawTile(x, y + 1) ~= RawTile(x, y) and RawTile(x, y - 1) == RawTile(x, y) and RawTile(x - 1, y) == RawTile(x, y) and RawTile(x + 1, y) == RawTile(x, y) and RawTile(x - 1, y - 1) == RawTile(x, y) and RawTile(x + 1, y - 1) == RawTile(x, y)) then
					RandomNumber = SyncRand(3)
					if (RandomNumber == 0) then
						SetTile(mixed_slot * 256 + 2 * 16, x, y, 0)
					elseif (RandomNumber == 1) then
						SetTile(mixed_slot * 256 + 2 * 16 + 1, x, y, 0)
					elseif (RandomNumber == 2) then
						SetTile(mixed_slot * 256 + 2 * 16 + 2, x, y, 0)
					end
				elseif (mixed_slot ~= 0 and RawTile(x, y - 1) ~= RawTile(x, y) and RawTile(x, y + 1) == RawTile(x, y) and RawTile(x - 1, y) == RawTile(x, y) and RawTile(x + 1, y) == RawTile(x, y) and RawTile(x - 1, y + 1) == RawTile(x, y) and RawTile(x + 1, y + 1) == RawTile(x, y)) then
					RandomNumber = SyncRand(3)
					if (RandomNumber == 0) then
						SetTile(mixed_slot * 256 + 11 * 16, x, y, 0)
					elseif (RandomNumber == 1) then
						SetTile(mixed_slot * 256 + 11 * 16 + 1, x, y, 0)
					elseif (RandomNumber == 2) then
						SetTile(mixed_slot * 256 + 11 * 16 + 2, x, y, 0)
					end
				elseif (mixed_slot ~= 0 and RawTile(x + 1, y) ~= RawTile(x, y) and RawTile(x - 1, y) == RawTile(x, y) and RawTile(x, y - 1) == RawTile(x, y) and RawTile(x, y + 1) == RawTile(x, y) and RawTile(x - 1, y - 1) == RawTile(x, y) and RawTile(x - 1, y + 1) == RawTile(x, y)) then
					RandomNumber = SyncRand(3)
					if (RandomNumber == 0) then
						SetTile(mixed_slot * 256 + 4 * 16, x, y, 0)
					elseif (RandomNumber == 1) then
						SetTile(mixed_slot * 256 + 4 * 16 + 1, x, y, 0)
					elseif (RandomNumber == 2) then
						SetTile(mixed_slot * 256 + 4 * 16 + 2, x, y, 0)
					end
				elseif (mixed_slot ~= 0 and RawTile(x - 1, y) ~= RawTile(x, y) and RawTile(x + 1, y) == RawTile(x, y) and RawTile(x, y - 1) == RawTile(x, y) and RawTile(x, y + 1) == RawTile(x, y) and RawTile(x + 1, y - 1) == RawTile(x, y) and RawTile(x + 1, y + 1) == RawTile(x, y)) then
					RandomNumber = SyncRand(3)
					if (RandomNumber == 0) then
						SetTile(mixed_slot * 256 + 9 * 16, x, y, 0)
					elseif (RandomNumber == 1) then
						SetTile(mixed_slot * 256 + 9 * 16 + 1, x, y, 0)
					elseif (RandomNumber == 2) then
						SetTile(mixed_slot * 256 + 9 * 16 + 2, x, y, 0)
					end
				elseif (mixed_slot ~= 0 and (RawTile(x, y - 1) ~= RawTile(x, y) or RawTile(x - 1, y) ~= RawTile(x, y)) and RawTile(x, y + 1) == RawTile(x, y) and RawTile(x + 1, y) == RawTile(x, y) and RawTile(x + 1, y + 1) == RawTile(x, y)) then
					RandomNumber = SyncRand(3)
					if (RandomNumber == 0) then
						SetTile(mixed_slot * 256 + 7 * 16, x, y, 0)
					elseif (RandomNumber == 1) then
						SetTile(mixed_slot * 256 + 7 * 16 + 1, x, y, 0)
					elseif (RandomNumber == 2) then
						SetTile(mixed_slot * 256 + 7 * 16 + 2, x, y, 0)
